import React from 'react';
import { MDBAccordion, MDBAccordionItem, MDBBtn } from 'mdb-react-ui-kit';

export default function App() {

  return (
    <MDBAccordion initialActive={1}>
      <MDBAccordionItem collapseId={1} headerTitle='Title 1'>
      <React.Fragment>
        <MDBBtn>
            <MDBIcon fas icon="arrow-up" />
            </MDBBtn> 
            </React.Fragment>
      </MDBAccordionItem>
      <MDBAccordionItem collapseId={2} headerTitle='Title 2'>
        Topic 2
      </MDBAccordionItem>
      <MDBAccordionItem collapseId={3} headerTitle='Title 3'>
        Topic 3
      </MDBAccordionItem>
    </MDBAccordion>
  );
}
